package loops;

public class NumberOutput {
//NESTED LOOPS
	public static void main(String[] args) {
		// TODO Auto-generated method stub
for (int row = 1; row <=5; row++)
{
	
	for (int column = row; column <= 5; column ++)
	{
		System.out.print(column);
	}
	System.out.println(row);
}

	}

}
